window.bookSummaryJSON = "<p><i>Behind the Throne</i> begins K. B. Wagers's action-packed science fiction adventure, with a heroine as rebellious as Han Solo, as savvy as Leia, and as skilled as Rey.</p> <p>Hail Bristol has made a name for herself as one of the most fearsome gunrunners in the galaxy. But she can't escape her past forever: Twenty years ago, she was a runaway princess of the Indranan Empire. Now, her mother's people have finally come to bring her home.</p> <p>But when Hail is dragged back to her Indrana to take her rightful place as the only remaining heir, she finds that trading her ship for a palace is her most dangerous move yet.</p> <p>In a world where the only safe options are fight or flight, Hail must rule.</p>"; 
